  fullName: System.Activities.ActivityFunc<T1,T2,T3,T4,T5,T6,TResult>
  type: Class
  summary: Defines an activity delegate with six in arguments of type <code>T</code> and one out argument of type <code>TResult</code>.
  remarks: "The <xref:System.Activities.ActivityDelegate> enables activity authors to expose callbacks with specific signatures that users of the activity can provide activity-based handlers for. ActivityFunc(T1, is an <xref:System.Activities.ActivityDelegate> that returns a value. The signature of the ActivityFunc(T1, is specified as generic type arguments.  \n  \n There are multiple generic versions of this type that take from 1 to 16 in arguments, plus the `out` argument, for the activity that is called. There are also **ActivityAction** types for activity delegates that do not return values."
